<description>寄生虫电影介绍《寄生虫》讲述了发生在身份地位悬殊的两个家庭身上的故事：宋康昊饰演的无业游民父亲基泽，让寄托了家人生计希望的大儿子（崔宇植饰）前往IT公司老总朴社长（李善均饰）家应聘课外教师，随之发生了一连串意外事件。[...]</description>
